        <img src="https://www.rateyourseats.com/seatingcharts/events/jennifer-lopez-ubs-arena-seating-chart-august-9-2024-4823188.jpg" />
      </div>
      <div>{tickettypes.map(TTypes)}</div>
    </div>
  );
}

export default View1;
